The `@ApplicationScoped` annotation is used to define the scope of a bean in CDI (Context and Dependency Injection). In Java EE, this annotation is part of the `javax.annotation` package, but in Jakarta EE (which Quarkus is based on), it has been moved to the `jakarta.annotation` package.

